    d->arg[0] = d_nlp.z;
    d->arg[1] = d_nlp.p;
    d->res[0] = &d_nlp.objective;
    d->res[1] = d->gf;
    d->res[2] = d_nlp.z+119;
    d->res[3] = d->Jk;
    if (casadi_f6(d->arg, d->res, d->iw, d->w, 0)) return 1;
